import {Component, inject, OnInit} from '@angular/core';
import {Router} from "@angular/router";
import {AuthService} from "./services/auth.service";

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.sass']
})
export class AppComponent implements OnInit{
  title = 'scoreboardpro'
  authService = inject(AuthService)
  ngOnInit() {
    this.authService.autoLogin();
  }
}
<div class="flex flex-col text-textBlack h-screen overflow-hidden">
    <!-- Sticky Header -->
    <div class="w-full z-10 fixed top-0">
        <app-header></app-header>
    </div>

    <!-- Main Content Area with Sidebar -->
    <div class="flex mt-20">
        <!-- Sticky Sidebar -->
        <div class="fixed w-60 h-full overflow-y-auto">
            <app-sidenav></app-sidenav>
        </div>

        <!-- Router Outlet Content -->
        <div class=" ml-60 py-4 px-8 bg-primaryBorderGrey overflow-y-auto w-full h-screen">
            <router-outlet class=""></router-outlet>
        </div>
    </div>
</div>
